This is the COMPLETE english translation of the greatest Evangelion hentai doujin I ever saw : Re-Take 1, 2, 3, 0, 4 and Re-Take After, drawn by Kimigabichi.

They come from that page (open it if you want more info on the story or galleries of pictures) : 
 &lt;a href=&quot;
http://www.hentairules.net/2007/05/19/evangelion-splendid-doujin-re-take-1-2-3-0-4-after-english-by-kimigabuchi/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.hentairules.net/2007/05/19/evangelion-splendid-doujin-re-take-1-2-3-0-4-after-english-by-kimigabuchi/&lt;/a&gt; 

This is a reprise of the last third of the 26 Evangelion episodes and of the movie End Of Evangelion, with slight variations, and after it, this is a sequel, developing the scenario so as to include the End Of Evangelion, and turn it into something that makes sense, something that has a GREAT ending.

If you are an Evangelion fan or former fan, leech it all and read it, it is a great, lovely, moving, fascinating story, with a &quot;wowsome&quot; ending. 

If you just want great hentai pictures, ask your client to download only the two first volumes, they are the ones who contain the more hentai pictures (Asuka deserves her read-head bitch surname, she even gets pregnant).

As for me, I finally felt that Evangelion was over, finished, at long last. And that felt great, I felt relieved, relieved, happy... the best a hentai doujin could bring, really.

Enjoy this, Evangelion fans :)
